import React from 'react';


export function Sound() {
    let audio = new Audio("https://www.youtube.com/watch?v=pAgnJDJN4VA")
  
    const start = async () => {
        try {
            await audio.play();
            console.log('Playing...');
          } catch (err) {
            console.log('Failed to play...' + err);
          }
    }
  
    return (
      < div >
        <button onClick={start}>Play</button>
      </div >
    );
  }
